import React from 'react'
import { Row, Col } from 'antd';
import { CloseCircleOutlined } from '@ant-design/icons';


const ChatBoxHeader = ({ room }) => {
    return (
        <Row justify="center">
            <Col xs={8} sm={8} md={8} lg={8} xl={8} xxl={8}>
                <h3>{room}</h3>
            </Col>
            <Col xs={8} sm={8} md={8} lg={8} xl={8} xxl={8}>
                <CloseCircleOutlined />
            </Col>
        </Row>
    )
}

export default ChatBoxHeader;
